import { apiClient } from "./ApiClient";

export function executeBasicAuthenticationService(token) {
    return apiClient.get(`basicauth`, {
        headers: {
            Authorization: token
        }
    });
}

export function executeJwtAuthenticationService(username, passowrd) {
    console.log(username + " " + passowrd);
    return apiClient.post(`authenticate`, {username, passowrd});
}
